import React, {Component} from 'react';
import Hosting from "./Hosting";
import Topservice from "./Topservice";

class Service extends Component {
    render() {
        return (
            <div>
                <Topservice/>
                <Hostings/>
            </div>
        );
    }
}

export default Service;
